import randomclass Agent:        def __init__(self):        self.__x = random.randint(0,99)        self.__y = random.randint(0,99)           @property    def y(self):        return self.__y        @y.setter    def set_y(self, y):        self.__y = y            @y.getter    def get_y(self):        return self.__y        @property    def x(self):        return self.__x        @y.setter    def set_x(self, x):        self.__x = x            @y.getter    def get_x(self):        return self.__x             def move(self):        if random.random() < 0.5:            self.__y = (self.__y + 1) % 100        else:            self.__y = (self.__y - 1) % 100                if random.random() < 0.5:            self.__x = (self.__x +1) % 100        else:            self.__x = (self.__x -1) % 100        